  list.appendChild(item); // \u89E6\u53D11000\u6B21\u91CD\u6392\uFF01\n  });\n}\n\n// \u2705 \u6B63\u786E\u793A\u4F8B\uFF1A\u6279\u91CFDOM\u64CD\u4F5C\nfunction efficientDOMOperations() {\n  const list = document.getElementById('product-list');\n  const products = getProducts();\n  const fragment = document.createDocumentFragment();\n  \n  // \u5728\u5185\u5B58\u4E2D\u6784\u5EFADOM\u7ED3\u6784\n  products.forEach(product => {\n    const item = document.createElement('div');\n    item.className = 'product-item';\n    item.innerHTML = `\n      <h3>${product.name}</h3>\n      <p>\xa5${product.price}</p>\n      <button onclick=\"addToCart(${product.id})\">\u52A0\u5165\u8D2D\u7269\u8F66</button>\n    `;\n    fragment.appendChild(item); // \u5728\u5185\u5B58\u4E2D\u64CD\u4F5C\n  });\n  \n  list.appendChild(fragment); // \u53EA\u89E6\u53D11\u6B21\u91CD\u6392\uFF01\n}\n\n// \u{1F680} \u9AD8\u7EA7\u793A\u4F8B\uFF1A\u865A\u62DFDOM\u6279\u91CF\u66F4\u65B0\nclass DOMBatcher {\n  constructor() {\n    this.updates = [];\n    this.isScheduled = false;\n  }\n  \n  scheduleUpdate(element, property, value) {\n    this.updates.push({ element, property, value });\n    \n    if (!this.isScheduled) {\n      this.isScheduled = true;\n      requestAnimationFrame(() => this.flushUpdates());\n    }\n  }\n  \n  flushUpdates() {\n    // \u6279\u91CF\u5E94\u7528\u6240\u6709\u66F4\u65B0\n    this.updates.forEach(({ element, property, value }) => {\n      element.style[property] = value;\n    });\n    \n    this.updates = [];\n    this.isScheduled = false;\n  }\n}\n\n// \u4F7F\u7528\u6279\u91CF\u66F4\u65B0\u5668\nconst batcher = new DOMBatcher();\n\nfunction animateElements() {\n  const elements = document.querySelectorAll('.animated-item');\n  \n  elements.forEach((element, index) => {\n    // \u8C03\u5EA6\u66F4\u65B0\u800C\u4E0D\u662F\u7ACB\u5373\u6267\u884C\n    batcher.scheduleUpdate(element, 'transform', `translateX(${index * 10}px)`);\n    batcher.scheduleUpdate(element, 'opacity', '0.8');\n  });\n}\n"})})]}),(0,s.jsxs)(a.A,{value:"fragment-usage",label:"DocumentFragment",children:[(0,s.jsx)(n.h4,{id:"documentfragment\u9AD8\u7EA7\u7528\u6CD5",children:"DocumentFragment\u9AD8\u7EA7\u7528\u6CD5"}),(0,s.jsx)(n.pre,{children:(0,s.jsx)(n.code,{className:"language-javascript",metastring:'title="DocumentFragment\u6700\u4F73\u5B9E\u8DF5"',children:"// \u57FA\u7840DocumentFragment\u4F7F\u7528\nclass DOMBuilder {\n  constructor() {\n    this.fragment = document.createDocumentFragment();\n  }\n  \n  // \u521B\u5EFA\u4EA7\u54C1\u5361\u7247\n  createProductCard(product) {\n    const card = document.createElement('div');\n    card.className = 'product-card';\n    card.dataset.productId = product.id;\n    \n    card.innerHTML = `\n      <div class=\"product-image\">\n        <img src=\"${product.image}\" alt=\"${product.name}\" loading=\"lazy\">\n        ${!product.inStock ? '<div class=\"out-of-stock\">\u7F3A\u8D27</div>' : ''}\n      </div>\n      <div class=\"product-info\">\n        <h3 class=\"product-name\">${product.name}</h3>\n        <p class=\"product-price\">\xa5${product.price}</p>\n        <div class=\"product-rating\">\n          ${this.createStarRating(product.rating)}\n        </div>\n        <button class=\"add-to-cart-btn\" ${!product.inStock ? 'disabled' : ''}>\n          ${product.inStock ? '\u52A0\u5165\u8D2D\u7269\u8F66' : '\u7F3A\u8D27'}\n        </button>\n      </div>\n    `;\n    \n    return card;\n  }\n  \n  // \u521B\u5EFA\u661F\u7EA7\u8BC4\u5206\n  createStarRating(rating) {\n    const stars = [];\n    for (let i = 1; i <= 5; i++) {\n      const starClass = i <= rating ? 'star-filled' : 'star-empty';\n      stars.push(`<span class=\"star ${starClass}\">\u2605</span>`);\n    }\n    return stars.join('');\n  }\n  \n  // \u6279\u91CF\u521B\u5EFA\u5E76\u6DFB\u52A0\u4EA7\u54C1\n  buildProductGrid(products, container) {\n    // \u6E05\u7A7A\u73B0\u6709\u5185\u5BB9\n    container.innerHTML = '';\n    \n    // \u6279\u91CF\u521B\u5EFA\u4EA7\u54